export const LoginStart = (userCredentials) => ({
    type: "LOGIN_START",
})

export const LoginSuccess = (user) => ({
    type: "LOGIN_SUCCESS",
    payload: user,
})
export const LoginFailure = () => ({
    type: "LOGIN_FAILURE",
})

export const Unfollow = (userId) => ({
    type: "UNFOLLOW",
    payload: userId,
})
